import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import styles from "./DietPlan.module.css";
import {
  fetchDailyDietPlan,
  markDayAsCompleted,
} from "../store/actions/dietActions";
import Spinner from "./Spinner";
import Popup from "./InstructionsPopup";

const DietPlan = ({ dietPlan }) => {
  const dispatch = useDispatch();
  const token = localStorage.getItem("token") || "";

  // Track which day is currently shown
  const [selectedDayIndex, setSelectedDayIndex] = useState(0);

  // Which meal is fetching data
  const [selectedMealIndex, setSelectedMealIndex] = useState(null);

  const loading = useSelector((state) => state.dailyDiet.loading);
  const completedDays = useSelector((state) => state.dailyDiet.completedDays);

  // Get the current day's plan
  const currentDayPlan = dietPlan[selectedDayIndex] || {};

  const handleMealClick = (mealIndex, mealData) => {
    setSelectedMealIndex(mealIndex);
    dispatch(fetchDailyDietPlan({ dietData: mealData, token }));
  };

  const handleCompletionToggle = () => {
    dispatch(markDayAsCompleted(selectedDayIndex));
  };

  const handlePrevDay = () => {
    if (selectedDayIndex > 0) {
      setSelectedDayIndex((prev) => prev - 1);
      setSelectedMealIndex(null);
    }
  };

  const handleNextDay = () => {
    if (selectedDayIndex < dietPlan.length - 1) {
      setSelectedDayIndex((prev) => prev + 1);
      setSelectedMealIndex(null);
    }
  };

  // Guard for empty or undefined dietPlan
  if (!dietPlan || dietPlan.length === 0) {
    return (
      <div className={styles.dietPlanContainer}>
        <p>No diet plan available.</p>
      </div>
    );
  }

  return (
    <div className={styles.dietPlanContainer}>
      {/* Bouncing Balls in the background */}
      <div className={styles.background}>
        <div className={styles.ball} />
        <div className={styles.ball} />
        <div className={styles.ball} />
        {/* Add more balls if you want */}
      </div>

      {/* Optional: Navigation Buttons */}
      <div className={styles.navigationBar}>
        <button
          className={styles.navButton}
          onClick={handlePrevDay}
          disabled={selectedDayIndex === 0}
        >
          &lt; Previous
        </button>
        <button
          className={styles.navButton}
          onClick={handleNextDay}
          disabled={selectedDayIndex === dietPlan.length - 1}
        >
          Next &gt;
        </button>
      </div>

      {/* Static Glassy Card */}
      <div
        className={`${styles.dayCard} ${
          completedDays.includes(selectedDayIndex) ? styles.completedDay : ""
        }`}
      >
        {/* Title */}
        <div className={styles.dayTitle}>
          Day {selectedDayIndex + 1}{" "}
          {currentDayPlan.day && `- ${currentDayPlan.day}`}
        </div>

        {/* (Optional) Completed / Not Completed Status */}
        {completedDays.includes(selectedDayIndex) ? (
          <div className={styles.completedText}>Completed!</div>
        ) : (
          <div className={styles.notCompletedText}>Not Completed</div>
        )}

        {/* Meals List */}
        <ul className={styles.mealsList}>
          {currentDayPlan.meals && currentDayPlan.meals.length > 0 ? (
            currentDayPlan.meals.map((meal, mealIndex) => (
              <React.Fragment key={mealIndex}>
                {selectedMealIndex === mealIndex && loading ? (
                  <div className={styles.spinnerContainer}>
                    <Spinner />
                  </div>
                ) : (
                  <li
                    className={styles.mealItem}
                    onClick={() => handleMealClick(mealIndex, meal)}
                  >
                    <strong>{meal.meal}</strong>
                  </li>
                )}
              </React.Fragment>
            ))
          ) : (
            <li className={styles.specialNote}>
              {currentDayPlan.day || "No meals for this day."}
            </li>
          )}
        </ul>

        {/* Mark as Complete Button */}
        <div className={styles.dayFooter}>
          <button
            className={`${styles.completeButton} ${
              completedDays.includes(selectedDayIndex) ? styles.completed : ""
            }`}
            onClick={handleCompletionToggle}
          >
            {completedDays.includes(selectedDayIndex)
              ? "Day Completed"
              : "Mark as Complete"}
          </button>
        </div>
      </div>

      {/* Any pop-up or extra info */}
      <Popup />
    </div>
  );
};

export default DietPlan;
